import React from "react";

const StoreItem = ({ name, desc, price, img }) => {
  return (
    <div>
      <h1>{name}</h1>
      <img src={img} alt="Store item" />
      <strong>{price}</strong>
      <p>{desc}</p>
    </div>
  );
};

export default StoreItem;
